import types from 'prop-types';
import React from 'react';
import { ContentContainer } from '../../../../components/ContentContainer';
import {Footer} from '../../../../components/Footer';
import {ContactsMap} from './../'


// Styles

import './styles.scss';

// ----------------

export const SectionContacts = () => {

  return (
    <section className="contacts">
      <ContactsMap />
    <ContentContainer maxWidth="1600">
      <div className="contacts__content">Hello
        {/* <SectionTitle
          className="contacts__title"
          fluidWidth
          color="secondary"
          title="Get in touch"/> */}

        {/* <Button withBorder borderColor smallSize> Submit </Button> */}

      </div>


    </ContentContainer>
    <Footer />
  </section>);
};

// ----------------

// Type of props

SectionContacts.propTypes = {
  prop: types.string,
};

// Default value for props

SectionContacts.defaultProps = {};
